import { FaHouse } from 'react-icons/fa6';
import classes from './add-item-header.module.css'


const AddItemHeader = () => {
    return (
             <header className={classes.header}>
                <div className={classes.homeIconBox}>
                    <FaHouse />
                </div>
              <h1 className={classes.title}>Add Post</h1>
             </header>
                );
              }

export default AddItemHeader
